import React from "react";
import Navbar from "./components/Navbar";
import FileUpload from "./components/FileUpload";
import LatencyCard from "./components/LatencyCard";
import SessionHistory from "./components/SessionHistory";
import Footer from "./components/Footer";
import { motion } from "framer-motion";

export default function App() {
  return (
    <motion.div
      className="min-h-screen flex flex-col bg-gradient-to-b from-[#0b0f1a] to-[#11182a] text-white"
      initial={{ opacity: 0 }}
      animate={{ opacity: 1 }}
      transition={{ duration: 0.8, ease: 'easeOut' }}
    >
      {/* Navbar */}
      <Navbar />

      {/* Hero Section */}
      <main className="flex flex-col items-center justify-center flex-grow px-4 py-12 text-center space-y-8">
        <div>
          <h1 className="text-5xl md:text-6xl font-extrabold bg-gradient-to-r from-[#5ee7ff] to-[#7c3aed] bg-clip-text text-transparent">
            Synaptra Core v3.0
          </h1>
          <p className="mt-4 text-lg md:text-xl text-gray-300 max-w-2xl mx-auto">
            Multimodal Embodied AI Agent â€” bridging Vision, Audio, Reasoning & Action.
          </p>
        </div>

        {/* Upload buttons */}
        <div className="flex flex-wrap justify-center gap-6">
          <FileUpload />
          <FileUpload />
        </div>

        {/* Latency Card */}
        <LatencyCard latency={84} />

        {/* Session History */}
        <section className="w-full max-w-3xl mt-10">
          <SessionHistory />
        </section>
      </main>

      {/* Footer */}
      <Footer />
    </motion.div>
  );
}
